import React, { Component } from 'react';
import Survey from '../../Pages/Survey'
import Stats from '../../Pages/Covit-19 Live Stats/Stats'
import About from '../../Pages/About'
import PageNotFOund from '../../Pages/PageNotFOund'
import {Route,Link,Switch,BrowserRouter as Router} from '../../../node_modules/react-router-dom'

class MyRouter extends Component {
    render() {
        return (
           
            <Router>
            <div>
            
       
        
              {/* A <Switch> looks through its children <Route>s and
                  renders the first one that matches the current URL. */}
              <Switch>
                <Route exact path="/about"> <About /> </Route>
                <Route exact path="/survey"> <Survey /> </Route>
                <Route exact path="/stats" component={Stats}>  <Stats /></Route>
                <Route component={PageNotFOund}/>
              </Switch>
            </div>
          </Router>

        );
    }
}

export default MyRouter;
